import CardMainTitle from "../components/card/CardMainTitle";
import CardTitleTag from "../components/card/CardTitleTag";
import dummy from "../json/cardText.json";

const Card4 = () => {
  const cardTag = dummy.cardTag;
  const cardListTag = cardTag.map((cardText, index) => (
    <CardTitleTag
      key={index}
      img={cardText.img}
      title={cardText.title}
      tag={cardText.tag}
    />
  ));

  return (
    <section className="section4li">
      <div>
        <CardMainTitle />
        <ul className="section4li_ul">
          <div>
            <div className="section4li_ul_list">
              <div>{cardListTag}</div>
            </div>
          </div>
        </ul>
      </div>
    </section>
  );
};

export default Card4;
